//main.js负责加载所有资源(组件，js，css)创建vue对象
import Vue from 'vue'
import App from './App.vue'
//1加载路由模块
import router from './router'
//1.1加载模块vueResource(发送ajax请求)
import VueResource from 'vue-resource'
//1.2将vueresource注册vue
Vue.use(VueResource);
//1.3将Mint-ui（美团开发的手机组件）加载项目
//1.4按需引入Header
//引入组件Swipe,SwipeItem
import {Header,Swipe,SwipeItem} from 'mint-ui'
 //1.5注册组件（vue第三天的）
 Vue.component(Header.name,Header)//注册Header
 Vue.component(Swipe.name,Swipe)//注册Swipe
 Vue.component(SwipeItem.name,SwipeItem)//注册SwipeItem
 //1.6引入mui css
import "./lib/mui/css/mui.css"
import "./lib/mui/css/icons-extra.css"  //购物车
//1.7引入mint-ui组件所需样式文件
//默认查找文件路径  node_mobules/mint-ui/lib/style.css
import "mint-ui/lib/style.css"
//是否是生产模式false
Vue.config.productionTip = false
//创建vue实现对象挂载public/index.html#app
new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
